import React from 'react';
import './../Header/Header.css';


// ICONS
import SearchIcon from '@mui/icons-material/Search';
import HomeIcon from '@mui/icons-material/Home';
import OndemandVideoIcon from '@mui/icons-material/OndemandVideo';
import GroupIcon from '@mui/icons-material/Group';
import GamepadIcon from '@mui/icons-material/Gamepad';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import { Avatar, IconButton } from '@mui/material';
import QuestionAnswerIcon from '@mui/icons-material/QuestionAnswer';
import AppsIcon from '@mui/icons-material/Apps';
import NotificationsIcon from '@mui/icons-material/Notifications';


const Header = () => {
    return (
       <div className="header">
        <div className="header__left">
            <img src="https://1000logos.net/wp-content/uploads/2021/04/Facebook-logo.png" alt="Logo__Header" />
            <div className="header__search_box">
                <SearchIcon />
                <input type="text" placeholder="Search on facebook" name="" id="" className="search__input" />
            </div>
        </div>
        <div className="header__middle">

            <HomeIcon fontSize='large'/>
            <OndemandVideoIcon  fontSize='large'/>
            <GroupIcon  fontSize='large'/>
            <GamepadIcon  fontSize='large'/>

        </div>
        <div className="header__right">
            <div className="profile__info">
                <Avatar />
                <p>Dipanjan Mukherjee</p>
            </div>
            <IconButton>
                <QuestionAnswerIcon />
            </IconButton>
            <IconButton>
                <NotificationsIcon />
            </IconButton>
            <IconButton>
                <AppsIcon />
            </IconButton>
               
                
        </div>
       </div>
    )
}

export default Header
